import filmes from './Services/dados.js'

const Lista = () => {
    return (
        <div>
            {filmes.map(filme => 
                    <li key = {filme.id}>
                        <h2>{filme.nome}</h2>
                        <img width={150} src = {filme.capa}/>
                        <h2>{filme.ano}</h2>
                        <h2>{filme.genero}</h2>
                        <h2>{filme.descricao}</h2>

                    </li>
                
                
                
                )}
        </div>
    )
}

export default Lista
